import Container from "../components/Container";
import { useState } from "react";

const CreateUser = () => {

    const [user, setUser] = useState({});

    const formProps = {
        onSubmit:  async (e) => {
            e.preventDefault();
            let res = await fetch("http://localhost:3000/users/create",
            {
                method: 'POST',
                // mode: 'no-cors',
                headers: {
                    'Accept': 'application/json;text/html',
                    'Content-Type': 'application/x-www-form-urlencoded;charset=UTF-8',
                },
                body: new URLSearchParams(user)
            })
            const resJson = await res.json();
            console.log(resJson);

        },
        fields: [
                {
                    label: 'User ID:',
                    inputType: 'number',
                    name: 'userId',
                    onChange:  (e) => setUserId({ ...user, userId: e.target.value}),
                },
                {
                    label: 'First Name:',
                    inputType: 'text',
                    name: 'firstName',
                    onChange:  (e) => setUserId({ ...user, firstName: e.target.value}),
                },
                {
                    label: 'Last Name:',
                    inputType: 'text',
                    name: 'lastName',
                    onChange:  (e) => setUserId({ ...user, lastName: e.target.value})
                },
                {
                    label: 'Birthday:',
                    inputType: 'Date',
                    name: 'birthday',
                    onChange:  (e) => setUserId({ ...user, birthday: e.target.value}),
                },
                {
                    label: 'Married:',
                    inputType: 'checkbox',
                    name: 'married',
                    onChange:  (e) => setUserId({ ...user, married: e.target.value}),
                }
            ],
            button: {
                value: 'Save User',
            }
        }
        return ( 
            <Container 
                title = 'Create User'
                formProps = {
                    formProps
                }
            />
        )
        }
        export default CreateUser;
